import React, {useState} from 'react'
import {Link} from 'react-router-dom';
import '../components/css/main.css'
import validateEmail from '../components/js/main'

import emailIcon from '../components/assets/email.png'
import passwordIcon from '../components/assets/password.png'

const apiEndpoint = 'https://2a2tyby9f2.execute-api.ap-southeast-2.amazonaws.com/Test/register';

const LoginForm = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  let [emailError,setEmailError] = useState('');
  let [passwordError,setPasswordError] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission (e.g., send data to the server)
    console.log('Email:', email);
    console.log('Password:', password);
  };

  return (
    <div className="container">
      <div className="header">
        <div className="text">Login</div>
        <div className="underline"></div>
      </div>
      <div className="inputs">
        <div className="input">
          <img src={emailIcon} alt="" />
          <input
            type="email"
            placeholder="Email Address"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <span id='emailError' className='error'>{emailError}</span>
        </div>
        <div className="input">
          <img src={passwordIcon} alt="" />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <span id='passwordError' className='error'>{passwordError}</span>
        </div>
      </div>
      <div className="subheader">
        New User? <Link to="/signup">Click Here!</Link>
      </div>
      <div className="submit-container">
        <button onClick={handleSubmit} className="submit">
          Login
        </button>
      </div>
    </div>
  );
};

export default LoginForm;
